import React, { useState } from 'react';
import './DataWindowNav.css';
import SecondaryButton from "../../components/SecondaryButton/SecondaryButton"; 

function DataWindowNav(setShowYourSurveys:React.Dispatch<React.SetStateAction<boolean>>, setShowData:React.Dispatch<React.SetStateAction<boolean>>) {
  return (
    <div className="datanav-container">
        <SecondaryButton width={'200px'} fontSize={'18px'} onClick={() => {
          setShowYourSurveys(true);
          setShowData(false);
        }}>Your Surveys</SecondaryButton>
        <SecondaryButton width={'200px'} fontSize={'18px'} onClick={() => {
          setShowYourSurveys(false);
          setShowData(true);
        }}>Survey Data</SecondaryButton>
    </div>
  )
};

export default DataWindowNav
